(16, '3', '193', '43', '', '', 'FUELLING PHENOM 300', '', '', '', '', '1584', '', '', '10', 'SINGLE POINT REFUELING\r\n<BR>\r\n<BR>\r\n- Maximum refueling time from empty to full is less than 12 minutes.\r\n<br>\r\n- The external control panel allows refueling the aircraft with no need to have someone inside the cockpit.\r\n\r\n\r\n<b>Hourly fuel burn</b>\r\n<br> - 1st hour 	166 US Gal (629 l)\r\n<br> - 2nd hour 	115 US Gal (435 l)\r\n\r\nMaximum range, 6 occupants @ 200 lb (91 kg) each. LRC speed, ISA en-route, NBAA IFR Reserves with 100 nm alternate. Takeoff @ Sea Level, ISA.\r\n\r\n<b>Mission fuel burn (max speed)</b>\r\n<br>300 nm 	1,058 lb (480 kg)\r\n<br>600 nm 	1,735 lb (787 kg)\r\n<br>1,000 nm 	2,471 lb (1,121 kg)\r\n<br><br>\r\n4 passengers @ 200lb (91kg), ISA and no wind en-route, NBAA IFR reserves (100nm alternate). Takeoff @ SL, ISA, Maximum Speed Cruise\r\n\r\n<b>Fuel capacity</b>\r\n<br>Maximum usable fuel 	5,353 lb (2,428 kg)\r\n<br>Adopted fuel density 6.70 lb/US gal (0,803 kg/l)\r\n\r\n<B>Embraer Phenom 300 Fuel Information:</B>\r\n\r\n    <BR>Embraer Phenom 300 Block Fuel for 1,000 nm: 2,403 lb / 1,090 kg\r\n    <BR>Fuel Type: Fuel Jet A, Jet A-1, JP-8 and similar fuels. Similar fuels must meet DEF STAN 91-91 and/or ASTM Standard Specification D1655 (last issues).\r\n    <BR>Fuel Capacity: 799 Gallons, 5,353.2 pounds (lbs) or 2,428.2 kilograms (kg)\r\n    <BR>Oil Capacity: 8.6 Quarts (US) or 8.14 liters.\r\n\r\nhttp://www.flightrun.com/embraer-phenom-300/specifications\r\nhttp://www.embraerexecutivejets.com/en-us/jets/phenom-300/pages/performance.aspx', ''),
