(276, '93', '231', '1', '', '487', 'MOOER MICRO SERIES OVERDRIVE THE JUICER ', '', '', '', '', '1', '', '51.84', '', 'The Juicer est le fruit dâ€™une Ã©troite collaboration entre Mooer et Neil Zaza, le Guitar Hero (do Brazil). Il sâ€™agit dâ€™un overdrive doux et ouvert conÃ§u pour donner du relief au canal crunch ou saturÃ© dâ€™un ampli Ã  lampes. Les sonoritÃ©s modernes de ce cocktail aux couleurs du BrÃ©sil sont une alternative aux pÃ©dales de type screamer qui apportent une teinte Vintage dont Neil ne veut pas. IdÃ©ale pour lisser le son dâ€™un solo, elle peut Ã©galement faire office de deuxiÃ¨me canal avec un bel Ã©ventail de sons crunch. The Juicer tient une place centrale dans le son de Neil Zaza, et sera une pÃ©dale de choix pour les guitaristes dÃ©sirant rÃ©vÃ©ler toute leur expressivitÃ©.\r\n<br><br>\r\n<b>CaractÃ©ristiques techniques:</b>\r\n<br>-Overdrive Signature Neil Zaza\r\n<br>-True Bypass\r\n<br>-BoÃ®tier mÃ©tal\r\n<br>-EntrÃ©e jack 1/4 mono (impÃ©dance 1M Ohms)\r\n<br>-Sortie jack 1/4 mono (impÃ©dance 100 Ohms)\r\n<br>-IntensitÃ© 20 mA\r\n<br>-Taille: 9,3Ã—4,2Ã—5,2cm\r\n<br>-Poids 160g\r\n<br>-Alimentation 9V\r\n', ''),
