(281, '93', '231', '1', '', '487', 'MOOER SLOW ENGINE', '', '', '', '', '', '', '', '', 'Le Slow Engine est un effet unique de montÃ©e de volume, recrÃ©ant lâ€™effet de lâ€™archer sur un violon. Souvent accompagnÃ© dâ€™un delay ou dâ€™un echo, il recrÃ©Ã©e sans effort le jeu au potentiomÃ¨tre de volume tout en vous libÃ©rant de cette acrobatie pour vous focaliser sur le jeu. Les rÃ©glages Sense et Attack procurent en plus de cet effet de volume, diffÃ©rentes sonoritÃ©s inÃ©dites apportant de nouvelles ambiances Ã  votre registre.\r\n<BR><BR>\r\n<B>CaractÃ©ristiques techniques:</B>\r\n<br>-PÃ©dale Slow Motion, effet de volume\r\n<br>-True Bypass\r\n<br>-BoÃ®tier mÃ©tal\r\n<br>-EntrÃ©e jack 1/4 mono (impÃ©dance 470k Ohms)\r\n<br>-Sortie jack 1/4 mono (impÃ©dance 100 Ohms)\r\n<br>-IntensitÃ© 128 mA\r\n<br>-Taille: 9,3Ã—4,2Ã—5,2cm\r\n<br>-Poids 170g\r\n<br>-Alimentation 9V\r\n\r\n', ''),
